  \"southwest-florida-shelf-ecosystems-analysis-study\",\n\t\"isopen\": false,\n\t\"url\":
  null,\n\t\"notes\": \"The Southwest Florida Shelf Ecosystems Analysis Study produced
  grain size analyses in the historic 073 format for 299 sea floor samples collected
  from October 25, 1980 to February 15, 1982 by the Venture during cruises ECO0-3
  in the Southwest Florida Continental Shelf in the Gulf of Mexico. Data include collecting
  institution, ship, cruise, sample id, latitude/longitude, date of collection, water
  depth, sampling device, method of analysis, sample weight, sampled interval, raw
  weight percentages of sediment, within a given phi range. Some samples also have
  percentages of total gravel, sand, silt, clay, and statistical measurements such
  as mean, median, skewness, kurtosis, and standard deviation of grain size. These
  data are part of the larger NGDC digital grain size database.\",\n\t\"license_title\":
